import React from "react";
import { Container, Grid } from "semantic-ui-react";
import Login from "../Login/Login";
import Navi from "../Navi/Navi";

export default function Dashboard() {
  return (
    <div className="App">
      <Image
			style={{position:'absolute',width:966, height:966, right:0, top:0, left:0, bottom:0}} 
			source={require('images/logo.png') } />
      <Grid columns={3} centered>
        <Grid.Row>
          <Grid.Column>
            <Grid.Column>
              <Navi />
            </Grid.Column>
          </Grid.Column>
        </Grid.Row>
        <Grid.Row>
          <Grid.Column>
            <Grid.Column>
                <Container>
                <Login />
                </Container>
            </Grid.Column>
          </Grid.Column>
        </Grid.Row>
      </Grid>
    </div>
  );
}
